B.xJ=new A.dU("Flutter Developer | Basetis, Barcelona | Jul 2022 - Now","RIVER, Grup Hiper Pas (a supermarket chain in Andorra) | Oct 2022 - Now\n\nWe started building this app from scratch as a team of 2 (a Senior focused on architecture and complex logic, and me - a Junior role, building the UI and basic logic). This project made me a person of reference for Flutter UI in our company, let me practice many API calls, taught me good practices.\n\nWhat I did:\n- Created a library of custom components like buttons, dialogs, text fields, discount coupons, carousels, cards etc., + UI models and enums for them (over 15 reusable components)\n- Created screens like login, home, profile etc. (18 in total)\n- Set up API calls following the Senior's lead, including coupons activation, email confirmation, password recovery etc. (15 in total)\n- Set the logic of password validation, discounts, barcode activation, decoding countries and cities, refreshing the queue, regular expressions for emails and passwords etc.\n- Implemented a single typographic theme w/ Material Design principles\n- Modified image assets using Adobe PS and SVG code\n- Suggested and implemented Lint rules to agilize the development\n\n\nLA MERC\xc8, Ajuntament de Barcelona (the main annual festival of Bcn) | Jul 2022- Sep 2022\n\nWe made changes to the old version of the app, updated the design, added new functionality. This project taught me to make reusable widgets, work in a diverse team and make an app fully accessible. This updated app launch has improved the Google play's app ranking from 2.6 to 4.0 and the App Store's from 3.6 to 4.1. The app has 150,000+ installs.\n\nWhat I did:\n- Updated the design of the majority of the app screens (over 10 screens), set new app icons, custom widgets (banners, carousels, etc.)\n- Implemented logic like string extensions, toggles, search bar, adjusting content based on device screen size, managing on-device push-notifications\n- Provided full app Accessibility for people with visual impairments (TalkBack, VoiceOver)\n- Worked in Adobe PS to create images for the stores",null,null)
